import whychooseus from "./components/whychooseus";
import wehelp from "./components/wehelp";
import popularproduct from "./components/popularproduct";
function App() 
{
  return (
  <>
  <navbar/>
  <hero/>
  <productsection/>
  <whychooseus/>
  <wehelp/>
  <popularproduct/>
  <footer/>
  </>

  )
}
export default App
